js指南
异步方法 
使用 async await 处理异步流程
处理异步方法，必须使用 try catch捕获异常
function onePromise() {
    return Promise.reolve('Hello Async')
}

async myFunc() {
    try {
        const result = await onePromise()
        console.log(result)
    }
    catch(e) {
        console.error(e)
    }
}

复杂的异常处理场景，考虑使用 Promise

异步当作同步方法来执行，async 可读性高
复杂异常场景的处理，Promise 复杂度更低

/**
 * async 处理复杂的异常情况
 */
function onePromise() {
    throw new Error('something wrong')
}

function failHandler() {
    throw new Error('I can not finish it')
}

async function myFunc() {
    try {
        const result = await onePromise()
        console.log('success')
    }
    catch(e) {
        console.error(e)
        try {
            await failHandler()
            console.log('no error')
        }
        catch(err) {
            console.error(err)
        }
    }
}

/**
 * Promise 处理复杂的异常情况
 */
function onePromise() {
    throw new Error('something wrong')
}

function failHandler() {
    throw new Error('I can not finish it')
}

function myFunc() {
    onePromise()
    .then(result => {
        console.log('success')
    })
    .catch(e => {
        return failHandler()
    })
    .then(result => {
        console.log('no error')
    })
    .catch(e => {
        console.error(e)
    })
}

